import React, { useState, useLayoutEffect } from "react";
import data from "../db.json";
import { useFormik } from "formik";

const getInitialValues = (data) => {
  if (!data) return;
  const values = [];
  data.forEach((item) => {
    if (item.name) values.push(item.name);
  });
  return values;
};

function Form(props) {
  return <></>;
}

export default Form;
